import React, { useState, useEffect } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import Sidebar from './components/layout/Sidebar';
import TopBar from './components/layout/TopBar';
import EnterpriseDashboard from './components/dashboard/EnterpriseDashboard';
import LeadsCRM from './components/crm/LeadsCRM';
import MayaChat from './components/maya/MayaChat';
import useStore from './store/useStore';
import { wsService } from './services/websocket';
import './styles/tailwind.css';
import './App.css';

// Placeholder components for other views
const RoomsView = () => (
  <div className="view-placeholder glass-card">
    <h2> 专</h2>
    <p>转爪转  专 转  拽专</p>
  </div>
);

const AnalyticsView = () => (
  <div className="view-placeholder glass-card">
    <h2>拽住</h2>
    <p>转 拽住 转拽   拽专</p>
  </div>
);

const AgentsView = () => {
  const { agents } = useStore();

  return (
    <div className="agents-view">
      <h2 className="view-title text-gradient"> 住</h2>
      <div className="agents-grid">
        {Object.entries(agents).map(([id, agent]) => (
          <motion.div
            key={id}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="agent-detail-card glass-card"
          >
            <div className="agent-header">
              <span className="agent-emoji">
                {id === 'scraper' && ''}
                {id === 'marketing' && ''}
                {id === 'creative' && ''}
                {id === 'sales' && ''}
                {id === 'operations' && '锔'}
              </span>
              <div>
                <h3>{id.charAt(0).toUpperCase() + id.slice(1)} Agent</h3>
                <span className={`status-pill ${agent.status}`}>
                  {agent.status === 'online' ? '驻注' : agent.status === 'busy' ? '注住拽' : ' 驻注'}
                </span>
              </div>
            </div>
            <div className="agent-stats">
              <div className="agent-stat">
                <span className="value">{agent.taskCount}</span>
                <span className="label">砖转</span>
              </div>
            </div>
          </motion.div>
        ))}
      </div>
    </div>
  );
};

const SettingsView = () => (
  <div className="view-placeholder glass-card">
    <h2>专转</h2>
    <p>专转 注专转  转 拽专</p>
  </div>
);

function App() {
  const { lang, sidebarOpen } = useStore();
  const [activeView, setActiveView] = useState('dashboard');
  const isRTL = lang === 'he';

  useEffect(() => {
    // Connect to WebSocket on mount
    wsService.connect();

    return () => {
      wsService.disconnect();
    };
  }, []);

  const renderView = () => {
    switch (activeView) {
      case 'dashboard':
        return <EnterpriseDashboard />;
      case 'crm':
        return <LeadsCRM />;
      case 'rooms':
        return <RoomsView />;
      case 'analytics':
        return <AnalyticsView />;
      case 'agents':
        return <AgentsView />;
      case 'settings':
        return <SettingsView />;
      default:
        return <EnterpriseDashboard />;
    }
  };

  return (
    <div 
      className={`app-enterprise ${sidebarOpen ? 'sidebar-open' : 'sidebar-collapsed'}`}
      dir={isRTL ? 'rtl' : 'ltr'}
    >
      {/* Sidebar */}
      <Sidebar activeView={activeView} setActiveView={setActiveView} />

      {/* Main Content */}
      <main className="main-content">
        <TopBar />
        <AnimatePresence mode="wait">
          <motion.div
            key={activeView}
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: -20 }}
            transition={{ duration: 0.2 }}
            className="view-container"
          >
            {renderView()}
          </motion.div>
        </AnimatePresence>
      </main>

      {/* Maya AI Chat */}
      <MayaChat />

      {/* Background Effects */}
      <div className="bg-effects">
        <div className="bg-gradient-1" />
        <div className="bg-gradient-2" />
        <div className="bg-grid" />
      </div>
    </div>
  );
}

export default App;
